import { useCallback } from "react";
import api from "../services/api";

const useListRepositories = async () => {
  try {
    const response = await api.get(`/user`);

    const { data } = response;
    console.log(data);

    if (!data) {
      console.error("An error has occurrend!");
    }

    return data;
  } catch (error) {
    console.error(error);
  }
  return null;
};
const useListRepositoriesData = () => {
  const response = useCallback(async () => {
    // eslint-disable-next-line react-hooks/rules-of-hooks
    const data = await useListRepositories();

    return data;
  }, [useListRepositories]);

  return { response };
};

export default useListRepositoriesData;
